import React from 'react';
import {Box, Button, Center, Flex, Heading, HStack, Image, Text, VStack} from "@chakra-ui/react";
import {useParams} from "react-router-dom";
import {BiShare, BsSkipStart, FcStart} from "react-icons/all";

const GradeQuiz = () => {

    //get id in params
    const {id} = useParams();

    return (
        <Box minH={'100vh'} p={10} bg={'gray.100'}>
            <Flex bg={'gray.100'} justifyContent={'center'}>
                <Box flex={3} align={'center'}>
                    <Box bg={'teal'} mx={5}>
                        <HStack>
                            <Image boxSize="100px"
                                   alt="Segun Adebayo"
                                   objectFit="cover"
                                   src="https://bit.ly/sage-adebayo"
                            />
                            <VStack align={'start'} textAlign={'start'}>
                                <Text>Title</Text>
                                <Text>Number of question</Text>
                            </VStack>
                        </HStack>
                    </Box>
                </Box>

                <Box borderRadius={'md'} boxShadow={'md'} flex={4} p={5} bg={'white'} align={'center'}>
                    <VStack w={300}>
                        <Button colorScheme={'teal'} size={'lg'} w={400}>Start</Button>
                        <Button size={'lg'} w={400}>Challenge</Button>
                        <Button leftIcon={<BiShare/>} size={'lg'} w={400}>Share</Button>
                    </VStack>
                </Box>

                <Box flex={3} align={'center'}>
                </Box>

            </Flex>
        </Box>
    );
};

export default GradeQuiz;
